import { useState } from 'react';
import CustomeForm from './CustomeForm';
import './style.css';
function App() {
  const [task, setTask] = useState([]);

  function addTask(task) {
    setTask(() => [...task, task]);
  }

  return (
    <div className='container'>
      <header>
        <h1>To Do App</h1>
      </header>
      <CustomeForm addTask={addTask} />
    </div>
  );
}

export default App;
